// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title ParliamentRegistry
 * @notice Registry of all AI agents in the parliament
 * Each agent has an on-chain identity, reputation score, and performance metrics
 */
contract ParliamentRegistry {

    struct Agent {
        string agentId;           // "utilitarian", "environmental", etc.
        string name;              // "The Consequentialist"
        address owner;            // Who deployed/controls this agent
        uint256 reputationScore;  // 0-1000, based on performance
        uint256 debatesParticipated;
        uint256 positionsChanged; // Intellectual honesty metric
        uint256 citationsProvided;
        bool isActive;
        string ipfsMetadataHash;  // Points to full agent config on IPFS
    }

    mapping(string => Agent) public agents;
    mapping(address => bool) public authorizedDeployers;

    event AgentRegistered(string indexed agentId, address owner);
    event ReputationUpdated(string indexed agentId, uint256 newScore);

    modifier onlyAuthorized() {
        require(authorizedDeployers[msg.sender], "Not authorized");
        _;
    }

    constructor() {
        authorizedDeployers[msg.sender] = true;
    }

    /**
     * @notice Register a new agent in the parliament
     */
    function registerAgent(
        string memory agentId,
        string memory name,
        string memory ipfsMetadataHash
    ) external onlyAuthorized {
        require(agents[agentId].owner == address(0), "Agent exists");

        agents[agentId] = Agent({
            agentId: agentId,
            name: name,
            owner: msg.sender,
            reputationScore: 500, // Start at middle
            debatesParticipated: 0,
            positionsChanged: 0,
            citationsProvided: 0,
            isActive: true,
            ipfsMetadataHash: ipfsMetadataHash
        });

        emit AgentRegistered(agentId, msg.sender);
    }

    /**
     * @notice Update agent reputation after debate
     */
    function updateReputation(
        string memory agentId,
        uint256 newScore
    ) external onlyAuthorized {
        require(newScore <= 1000, "Score too high");
        agents[agentId].reputationScore = newScore;
        emit ReputationUpdated(agentId, newScore);
    }

    /**
     * @notice Get agent details
     */
    function getAgent(string memory agentId) 
        external 
        view 
        returns (Agent memory) 
    {
        return agents[agentId];
    }
}

contracts/ParliamentToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title ParliamentToken (PARL)
 * @notice Governance token for AI Parliament
 * Holders can:
 * - Vote on agent additions/removals
 * - Stake on debate outcomes
 * - Earn rewards for quality participation
 */
contract ParliamentToken is ERC20, Ownable {

    mapping(address => uint256) public stakedBalance;
    mapping(uint256 => mapping(address => uint256)) public debateStakes;

    event Staked(address indexed user, uint256 amount);
    event Unstaked(address indexed user, uint256 amount);
    event DebateStaked(address indexed user, uint256 debateId, uint256 amount);
    event RewardDistributed(address indexed user, uint256 amount);

    constructor() ERC20("Parliament Token", "PARL") Ownable(msg.sender) {
        _mint(msg.sender, 1000000 * 10**18); // 1M initial supply
    }

    /**
     * @notice Stake tokens to participate in governance
     */
    function stake(uint256 amount) external {
        require(balanceOf(msg.sender) >= amount, "Insufficient balance");
        _transfer(msg.sender, address(this), amount);
        stakedBalance[msg.sender] += amount;
        emit Staked(msg.sender, amount);
    }

    /**
     * @notice Unstake tokens
     */
    function unstake(uint256 amount) external {
        require(stakedBalance[msg.sender] >= amount, "Insufficient staked");
        stakedBalance[msg.sender] -= amount;
        _transfer(address(this), msg.sender, amount);
        emit Unstaked(msg.sender, amount);
    }

    /**
     * @notice Stake on a debate outcome (prediction market)
     */
    function stakeOnDebate(uint256 debateId, uint256 amount) external {
        require(stakedBalance[msg.sender] >= amount, "Insufficient staked");
        debateStakes[debateId][msg.sender] += amount;
        emit DebateStaked(msg.sender, debateId, amount);
    }

    /**
     * @notice Distribute rewards (called by owner after debate)
     */
    function distributeRewards(address[] memory recipients, uint256[] memory amounts) 
        external 
        onlyOwner 
    {
        require(recipients.length == amounts.length, "Length mismatch");

        for (uint i = 0; i < recipients.length; i++) {
            _mint(recipients[i], amounts[i]);
            emit RewardDistributed(recipients[i], amounts[i]);
        }
    }
}

